// src/components/RegularHours.js
import React from "react";

const RegularHours = () => {
  const hours = [
    { range: "Monday – Thursday", openTime: "8:00 AM", closeTime: "7:45 PM" },
    { range: "Friday", openTime: "9:00 AM", closeTime: "7:45 PM" },
    { range: "Saturday – Sunday", openTime: "9:00 AM", closeTime: "5:45 PM" },
  ];

  return (
    <div>
      <h3>Regular Customer Service Hours</h3>
      <ul>
        {hours.map((hour, index) => (
          <li key={index}>
            {hour.range}: {hour.openTime} ET – {hour.closeTime} ET
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RegularHours;
